let saseul = require('./index.js').SASEUL;

let requestData = {
    type: 'ListNFT',
    version: '1.2.2.13',
    from: '0x6f2d9cac6e16066189289e0a08d25cb7851fee0c3ba523',
    page: 1,
    count: 20,
    sort: 1,
    timestamp: saseul.microseconds() + 1000000
};
saseul.request('https://aria.itemverse.io', requestData).then(res => {
    console.log(res);
});

let keyPair = saseul.makeKeypair();
let transactionData = {
    type: 'CreateNFT',
    version: '1.2.2.13',
    from: keyPair.address,
    class: 'nodejs test class',
    name: 'nodejs test name',
    thumbnail: '',
    metadata: {
        description: 'cute orange mush',
        image: '',
    },
    timestamp: saseul.microseconds() + 1000000
};
saseul.transaction('https://aria.itemverse.io', transactionData, keyPair.private_key).then(res => {
    console.log(res);
});
